const NavBar= () =>{
  return (
    <nav className="navbar navbar-expand-md bg-light">
      <MixerLogo />
      <div className="mx-auto order-0 nav-main">
        FitnessAI
      </div> 
    </nav>
  )
};
export default NavBar;
